// src/App.js

import React from 'react';
import UserForm from './components/UserForm';
import UserList from './components/UserList';
import UsersByGender from './components/UsersByGender';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

// function App() {
//   return (
//     <div className="App">
//       <h1>User Registration Form</h1>
//       <UserForm />
//       <h1>This list is registed users</h1>
//       <UserList />
//       <h1>this list are user by gender</h1>
//       <UsersByGender />
//     </div>
//   );
// }
const App = () => {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/">
            <UserForm />
          </Route>
          <Route path="/all-users">
            <UserList />
          </Route>
          <Route path="/users-by-gender">
            <UsersByGender />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;
